import Navbar from "./Navbar";
import Forecast from "./Forecast";
import TodaysForecast from "./TodaysForecast";
import DetailedForecast from "./DetailedForecast";
import SevenDayForecast from "./SevenDayForecast";
import sunny from '../svg/sunny.svg';
import cloudy from '../svg/cloudy.svg';
import rainy from '../svg/rainy.svg';
import sunnyRainy from '../svg/sunnyRainy.svg';
import thunder from '../svg/thunder.svg';

function App() {
  const weatherIcons = {
    Sunny: sunny,
    Cloudy: cloudy,
    Rainy: rainy,
    "Partly Cloudy": sunnyRainy,
    Thunderstorms: thunder,
  };

  return (
    <div className="w-screen h-screen bg-obsidian text-white grid grid-cols-body grid-rows-body gap-4 justify-items-center items-center">
      <Navbar />
      <input type="text" placeholder="Search for cities" className="border-0 bg-light-obsidian h-50 w-600 rounded-2xl p-4 outline-none self justify-self-start" />

      <SevenDayForecast weatherIcons={weatherIcons} />

      <Forecast weatherIcons={weatherIcons} />

      <TodaysForecast weatherIcons={weatherIcons} />
          <DetailedForecast />
    </div>
  );
}

export default App;
